    result += cvor[14]*y[14]*imw[14]; /*CH3 */
    result += cvor[15]*y[15]*imw[15]; /*CO2 */
    result += cvor[16]*y[16]*imw[16]; /*CH4 */
    result += cvor[17]*y[17]*imw[17]; /*C2H3 */
    result += cvor[18]*y[18]*imw[18]; /*C2H4 */
    result += cvor[19]*y[19]*imw[19]; /*C2H5 */
