    result += cvor[27]*y[27]*imw[27]; /*P-C3H4 */
    result += cvor[28]*y[28]*imw[28]; /*A-C3H4 */
    result += cvor[29]*y[29]*imw[29]; /*A1 */
    result += cvor[30]*y[30]*imw[30]; /*A1- */
