    XW += x[8]*31.998800; /*O2 */
    XW += x[9]*33.006770; /*HO2 */
    XW += x[10]*13.019120; /*CH */
    XW += x[11]*28.010550; /*CO */
    XW += x[12]*29.018520; /*HCO */
    XW += x[13]*30.026490; /*CH2O */
    XW += x[14]*15.035060; /*CH3 */
