    XW += x[24]*41.073300; /*A-C3H5 */
    XW += x[25]*43.089240; /*N-C3H7 */
    XW += x[26]*30.070120; /*C2H6 */
    XW += x[27]*40.065330; /*P-C3H4 */
    XW += x[28]*40.065330; /*A-C3H4 */
    XW += x[29]*78.114720; /*A1 */
    XW += x[30]*77.106750; /*A1- */
    XW += x[31]*65.095600; /*C5H5 */
    XW += x[32]*42.081270; /*C3H6 */
    XW += x[33]*56.108360; /*C4H8 */
    XW += x[34]*66.103570; /*C5H6 */
    XW += x[35]*128.175260; /*A2 */
    XW += x[36]*70.135450; /*C5H10 */
    XW += x[37]*71.143420; /*C5H11 */
    XW += x[38]*103.144990; /*A1C2H2 */
